(self.webpackChunk=self.webpackChunk||[]).push([[6183],{8302:(e,t,a)=>{"use strict";a.r(t),a.d(t,{data:()=>r});const r={key:"v-4650642a",path:"/_draft/Javascript/Object%20&%20Prototype.html",title:"",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"Date: 2021-04-02",slug:"date-2021-04-02",children:[]},{level:2,title:"Object와 Prototype",slug:"object와-prototype",children:[{level:3,title:"객체 기반 스크립트 언어",slug:"객체-기반-스크립트-언어",children:[]},{level:3,title:"객체 생성",slug:"객체-생성",children:[]}]}],filePathRelative:"_draft/Javascript/Object & Prototype.md",git:{updatedTime:null,contributors:[]}}},47:(e,t,a)=>{"use strict";a.r(t),a.d(t,{default:()=>d});const r=(0,a(6252).uE)('<h2 id="date-2021-04-02" tabindex="-1"><a class="header-anchor" href="#date-2021-04-02" aria-hidden="true">#</a> Date: 2021-04-02</h2><h2 id="object와-prototype" tabindex="-1"><a class="header-anchor" href="#object와-prototype" aria-hidden="true">#</a> Object와 Prototype</h2><h3 id="객체-기반-스크립트-언어" tabindex="-1"><a class="header-anchor" href="#객체-기반-스크립트-언어" aria-hidden="true">#</a> 객체 기반 스크립트 언어</h3><p>자바스크립트는 객체 기반의 스크립트 언어로, 자바스크립트를 이루고 있는 거의 모든(원시 타입 제외) 것이 객체이다. 자바스크립트의 객체는 키-값으로 구성된 프로퍼티들의 집합이다. 키의 값은 문자열 혹은 Symbol만 가능하며, 이외의 값은 모두 문자열로 변환된다.</p><p>자바스크립트의 객체는 프로토타입을 이용해 객체의 프로퍼티와 메소드를 상속받을 수 있다.</p><h3 id="객체-생성" tabindex="-1"><a class="header-anchor" href="#객체-생성" aria-hidden="true">#</a> 객체 생성</h3><p>함수를 사전에 정의한 뒤, 해당 함수를 <code>new</code>연산자를 이용해 부르면 반환값으로 인스턴스를 생성한다. ES6에서 도입된 클래스도, 엄밀히 말하면 함수로 만든 문법적 설탕이다.</p>',7),d={render:function(e,t){return r}}}}]);